import React, { useState, useEffect } from 'react';
import Web3 from 'web3';
import VotingContract from './contracts/VotingContract.json';

function App() {
  const [web3, setWeb3] = useState(null);
  const [contract, setContract] = useState(null);
  const [candidateList, setCandidateList] = useState([]);
  const [selectedCandidate, setSelectedCandidate] = useState('');
  const [voterName, setVoterName] = useState('');
  const [voterAge, setVoterAge] = useState('');
  const [voterCitizenshipNumber, setVoterCitizenshipNumber] = useState('');
  const [registrationStatus, setRegistrationStatus] = useState(false);
  const [voteCasted, setVoteCasted] = useState(false);
  const [newCandidateName, setNewCandidateName] = useState('');
  const [newCandidateRegistered, setNewCandidateRegistered] = useState(false);

  useEffect(() => {
    initializeWeb3();
    initializeContract();
  }, []);

  const initializeWeb3 = async () => {
    if (window.ethereum) {
      const web3Instance = new Web3(window.ethereum);
      try {
        await window.ethereum.enable();
        setWeb3(web3Instance);
      } catch (error) {
        console.error(error);
      }
    } else if (window.web3) {
      const web3Instance = new Web3(window.web3.currentProvider);
      setWeb3(web3Instance);
    } else {
      console.log('No Ethereum browser detected. You should consider trying MetaMask.');
    }
  };

  const initializeContract = async () => {
    try {
      const networkId = await web3.eth.net.getId();
      const deployedNetwork = VotingContract.networks[networkId];
      const contractInstance = new web3.eth.Contract(
        VotingContract.abi,
        deployedNetwork && deployedNetwork.address
      );
      setContract(contractInstance);
      fetchCandidates();
    } catch (error) {
      console.error('Error initializing contract:', error);
    }
  };

  const fetchCandidates = async () => {
    try {
      const candidates = await contract.methods.getCandidates().call();
      setCandidateList(candidates);
    } catch (error) {
      console.error('Error fetching candidates:', error);
    }
  };

  const handleCandidateSelection = (event) => {
    setSelectedCandidate(event.target.value);
  };

  const handleVoterNameChange = (event) => {
    setVoterName(event.target.value);
  };

  const handleVoterAgeChange = (event) => {
    setVoterAge(event.target.value);
  };

  const handleVoterCitizenshipNumberChange = (event) => {
    setVoterCitizenshipNumber(event.target.value);
  };

  const handleVoterRegistration = async () => {
    try {
      await contract.methods.registerVoter(voterName, parseInt(voterAge), voterCitizenshipNumber)
        .send({ from: web3.eth.defaultAccount });
      setRegistrationStatus(true);
    } catch (error) {
      console.error('Error registering voter:', error);
    }
  };

  const handleVoteCasting = async () => {
    try {
      await contract.methods.castVote(selectedCandidate)
        .send({ from: web3.eth.defaultAccount });
      setVoteCasted(true);
    } catch (error) {
      console.error('Error casting vote:', error);
    }
  };

  const handleNewCandidateNameChange = (event) => {
    setNewCandidateName(event.target.value);
  };

  const handleCandidateRegistration = async () => {
    try {
      await contract.methods.registerCandidate(newCandidateName)
        .send({ from: web3.eth.defaultAccount });
      setNewCandidateRegistered(true);
      setNewCandidateName('');
      fetchCandidates();
    } catch (error) {
      console.error('Error registering candidate:', error);
    }
  };

  return (
    <div className="App">
      <h1>Voting Application</h1>
      <h2>Candidate Registration</h2>
      <div>
        <label htmlFor="newCandidateName">Candidate Name:</label>
        <input
          id="newCandidateName"
          type="text"
          value={newCandidateName}
          onChange={handleNewCandidateNameChange}
        />
        <button onClick={handleCandidateRegistration}>Register Candidate</button>
        {newCandidateRegistered && <p>Candidate registered successfully!</p>}
      </div>
      <select onChange={handleCandidateSelection}>
        <option value="">Select a candidate</option>
        {candidateList.map((candidate, index) => (
          <option key={index} value={candidate}>{candidate}</option>
        ))}
      </select>
      <h2>Voter Registration</h2>
      <div>
        <label htmlFor="voterName">Name:</label>
        <input
          id="voterName"
          type="text"
          value={voterName}
          onChange={handleVoterNameChange}
        />
      </div>
      <div>
        <label htmlFor="voterAge">Age:</label>
        <input
          id="voterAge"
          type="number"
          value={voterAge}
          onChange={handleVoterAgeChange}
        />
      </div>
      <div>
        <label htmlFor="voterCitizenshipNumber">Citizenship Number:</label>
        <input
          id="voterCitizenshipNumber"
          type="text"
          value={voterCitizenshipNumber}
          onChange={handleVoterCitizenshipNumberChange}
        />
      </div>
      <button onClick={handleVoterRegistration}>Register Voter</button>
      {registrationStatus && <p>Voter registered successfully!</p>}
      <h2>Vote Casting</h2>
      <button onClick={handleVoteCasting} disabled={!selectedCandidate}>Cast Vote</button>
      {voteCasted && <p>Vote casted successfully!</p>}
    </div>
  );
}

export default App;
